import HanbitSoft from "../images/metaSai/hanbitSoft.png";
import SmileShark from "../images/metaSai/SmileShark.png";
import Cocktailmedia from "../images/metaSai/Cocktailmedia.png";
import Kaan from "../images/metaSai/kaan.png";
import Xoplay from "../images/metaSai/xoplay.png";


const dataPartner = [
  {
    id: 1,
    img: HanbitSoft,
  },
  {
    id: 2,
    img: SmileShark,
  },
  {
    id: 3,
    img: Cocktailmedia,
  },
  {
    id: 4,
    img: Kaan,
  },
  {
    id: 5,
    img: Xoplay,
  }
];

export default dataPartner;
